import { Link } from "react-router-dom";
import { useParams } from 'react-router-dom';


const Dashboard = () => {

    const { userId } = useParams();

    return (
        <>
            <p>This is the userId: {userId}</p>
            <div className="flex flex-row">
                <div className="flex flex-col"><ul className="menu bg-base-200 rounded-box w-56">
                    <li><a>Item 1</a></li>
                    <li><a>Item 2</a></li>
                    <li><a>Item 3</a></li>
                </ul></div>
                <div><p>Second column</p></div>

            </div>

        </>
    )
}

export default Dashboard;
